import React from 'react';
import CategoryButton from './CategoryButton'
import { FaPercent } from 'react-icons/fa'
import { GiMeal } from 'react-icons/gi'

const MenuHeader = () => {
    return (
        <div className='container'>
            <CategoryButton
                name='Deals'
                icon= {<FaPercent />}
            />
            <CategoryButton
                name='Entrees'
                icon= {<GiMeal />}
            />
        </div>
    );
};

export default MenuHeader;
